/**
 * Sets the rotation components by angle and axis. (Rotation is counter clockwise.)
 * @param {Number[]|Float32Array} a - 4x4 matrix (Array of length 16)
 * @param r
 * @param x
 * @param y
 * @param z
 * @returns {Number[]|Float32Array}
 */
function setRotation3(a, r, x, y, z){
    var len = Math.sqrt(x * x + y * y + z * z);

    if (len < 0.0001) {
        return null;
    }

    var s, c, t;
    var a00, a01, a02, a03;
    var a10, a11, a12, a13;
    var a20, a21, a22, a23;
    var b00, b01, b02;
    var b10, b11, b12;
    var b20, b21, b22;


    len = 1 / len;

    x *= len;
    y *= len;
    z *= len;

    s = Math.sin(r);
    c = Math.cos(r);
    t = 1 - c;

    a00 = a11 = a22 = 1;
    a01 = a02 = a03 = a10 = a12 = a13 = a20 = a21 = a23 = 0;

    b00 = x * x * t + c;
    b01 = y * x * t + z * s;
    b02 = z * x * t - y * s;
    b10 = x * y * t - z * s;
    b11 = y * y * t + c;
    b12 = z * y * t + x * s;
    b20 = x * z * t + y * s;
    b21 = y * z * t - x * s;
    b22 = z * z * t + c;

    a[0 ] = a00 * b00 + a10 * b01 + a20 * b02;
    a[1 ] = a01 * b00 + a11 * b01 + a21 * b02;
    a[2 ] = a02 * b00 + a12 * b01 + a22 * b02;
    a[3 ] = a03 * b00 + a13 * b01 + a23 * b02;
    a[4 ] = a00 * b10 + a10 * b11 + a20 * b12;
    a[5 ] = a01 * b10 + a11 * b11 + a21 * b12;
    a[6 ] = a02 * b10 + a12 * b11 + a22 * b12;
    a[7 ] = a03 * b10 + a13 * b11 + a23 * b12;
    a[8 ] = a00 * b20 + a10 * b21 + a20 * b22;
    a[9 ] = a01 * b20 + a11 * b21 + a21 * b22;
    a[10] = a02 * b20 + a12 * b21 + a22 * b22;
    a[11] = a03 * b20 + a13 * b21 + a23 * b22;

    return a;
}

