function fromQuat(a,b){
    var x = b[0];
    var y = b[1];
    var z = b[2];
    var w = b[3];

    var x2 = x + x;
    var y2 = y + y;
    var z2 = z + z;

    var xx = x * x2;
    var xy = x * y2;
    var xz = x * z2;

    var yy = y * y2;
    var yz = y * z2;
    var zz = z * z2;

    var wx = w * x2;
    var wy = w * y2;
    var wz = w * z2;

    a[ 0] = 1 - ( yy + zz );
    a[ 4] = xy - wz;
    a[ 8] = xz + wy;

    a[ 1] = xy + wz;
    a[ 5] = 1 - ( xx + zz );
    a[ 9] = yz - wx;

    a[ 2] = xz - wy;
    a[ 6] = yz + wx;
    a[10] = 1 - ( xx + yy );

    a[ 3] = a[ 7] = a[11] = a[12] = a[13] = a[14] = 0;
    a[15] = 1;

    return a;
}

